import React from 'react';

const Footer = () => {
    return (
        <div className="Footer">
            Global Burden of Disease Collaborative Network. Global Burden of Disease Study 2017 (GBD 2017) Results.
            <br/>Seattle, United States: Institute for Health Metrics and Evaluation (IHME), 2018.
            <br/>Available from http://ghdx.healthdata.org/gbd-results-tool.
        </div>
    );
};

export default Footer;
